  const closeAddmodal = () => {
    setAddmodalOpen(false);}


    return (
      <div className='container'>
        <button className='close' onClick={closeAddmodal}>
          X
        </button>
        <b>메뉴 추가</b>
        <p>이름<input></input></p>
        <p>가격<input></input></p>
        <p>상품 이미지<input></input></p>
      </div>
    );
  }

export default Addmodal;
